import { Request } from "express";
import APIEndpoint from "../../../../mvc/api/APIEndpoint";
import APIRoute from "../../../../mvc/api/APIRoute";
import RequestMethod from "../../../../mvc/requests/RequestMethod";
import APIController from "../../../APIController";
import APIResponse from "../../../responses/APIResponse";

class PostRoute extends APIRoute<void, BeansEndpoint> {

    public constructor(endpoint: BeansEndpoint) {
        super(endpoint, RequestMethod.POST);
    }

    protected async doHandle(req: Request): Promise<APIResponse<void>> {
        return this.fail("api.beans.too_powerful", {});
    }
}

class GetRoute extends APIRoute<string, BeansEndpoint> {

    public constructor(endpoint: BeansEndpoint) {
        super(endpoint, RequestMethod.GET);
    }

    protected async doHandle(req: Request): Promise<APIResponse<string>> {
        return this.success(BEAN_DATA);
    }
}

export default class BeansEndpoint extends APIEndpoint {

    private readonly _post: PostRoute;
    private readonly _get: GetRoute;

    public constructor(controller: APIController) {
        super(controller, "beans", "beans", 2);
        this._post = new PostRoute(this);
        this._get = new GetRoute(this);
    }

    protected setup(): void {
        this.addRoute(this._get);
        this.addRoute(this._post);
    }
}

const BEAN_DATA: string = "data:image/jpeg;base64,";